import './App.css';
import WalletDashboard from './App/pages/WalletDashboard';
import Login from './App/pages/Login';
function App() {
  const usersss = JSON.parse(localStorage.getItem('users'));
  if (usersss['user_id']) {
      return (
		<>
		  <WalletDashboard />
		</>
	  );
  }else{
  		return (
		<>
		  <Login />
		</>
	  );
  }
}

export default App;
